public class InnerConnectionAuthParametersFactory(Action<Humidifier.Events.ConnectionTypes.AuthParameters> factoryAction = null) : SubResourceFactory<Humidifier.Events.ConnectionTypes.AuthParameters>
{

    internal InnerConnectionConnectionHttpParametersFactory InvocationHttpParametersFactory { get; set; }

    internal InnerConnectionBasicAuthParametersFactory BasicAuthParametersFactory { get; set; }

    internal InnerConnectionApiKeyAuthParametersFactory ApiKeyAuthParametersFactory { get; set; }

    internal InnerConnectionOAuthParametersFactory OAuthParametersFactory { get; set; }

    protected override Humidifier.Events.ConnectionTypes.AuthParameters Create()
    {
        var authParametersResult = CreateAuthParameters();
        factoryAction?.Invoke(authParametersResult);

        return authParametersResult;
    }

    private Humidifier.Events.ConnectionTypes.AuthParameters CreateAuthParameters()
    {
        var authParametersResult = new Humidifier.Events.ConnectionTypes.AuthParameters();

        return authParametersResult;
    }
    public override void CreateChildren(Humidifier.Events.ConnectionTypes.AuthParameters result)
    {
        base.CreateChildren(result);

        result.InvocationHttpParameters ??= InvocationHttpParametersFactory?.Build();
        result.BasicAuthParameters ??= BasicAuthParametersFactory?.Build();
        result.ApiKeyAuthParameters ??= ApiKeyAuthParametersFactory?.Build();
        result.OAuthParameters ??= OAuthParametersFactory?.Build();
    }

} // End Of Class

